"""Package providing processes run by the machine_manager to execute tasks.

Each process has a
generator called self.tasklets, which is a generator that, when iterated over,
will execute functions.  We use tasklets and not a __next__ function so we
can reassign tasklets to something like cancel_behavior, pause behavior, etc.

Processes have a strong sense of both _state_ and _step_.  The state is the
process independent task.  Possible tasks are made up of: cancellable and
not_cancellable.  Only the Process superclass modulates state.

The step is a process dependent string describing what the process is currently
doing.  The Process superclass does not module the step except for creating
the initial "running" step.  It is up to the inheriting process to change
step.
"""
